import { Row, Col } from 'antd';

const AboutMe = () => {
  return (
    <Row>
        <Col span={6}>123</Col>
        <Col span={18}>
            <span>
                I am currently an undergraduate student at <a href="https://www.usc.edu/">University of Southern California</a>, pursuing a bachelor degree in Computer Science, 
                and a minor in Applied Analytics. My fields of interest are video game development, data engineering, and web technology.
            </span>
        </Col>
    </Row>
  );
};

export default AboutMe;
